# prompt: write a code to read csv file from google drive and convert it to a list

import pandas as pd
from google.colab import drive
drive.mount('/content/drive')

"""# 3. Read the CSV File from Google Drive
Read the file from drive first as Pandas Dataframe. Our transformers pipeline expects a list. So, we need to convert them into a list.

For our sentiment analysis, we will use the Flipkart Boat Rockerz 400 reviews. Dataset downloaded from [Kaggle.com Flipkart Customer Reviews](https://www.kaggle.com/datasets/kabirnagpal/flipkart-customer-review-and-rating/data)

![boat_rockerz.JPG](data:image/jpeg;base64,)
"""

data_path = '/content/drive/My Drive/Colab Notebooks/NLP/flipkart_boat_reviews.csv'
df = pd.read_csv(data_path)
print(df)
data_list = df['review'].values.tolist()
print(data_list[0])

"""# 4. Perform Preprocessing
Although transformers pipeline does preprocessing, let us do some basic preprocessing to remove invalid characters.
"""

import re

# Remove the ðŸ˜ ðŸ¤©ðŸ”¥ðŸ”¥ and READ MORE occurrences
data_list = [re.sub(r'ðŸ˜', '', review) for review in data_list]
data_list = [re.sub(r'¤', '', review) for review in data_list]
data_list = [re.sub(r'¥', '', review) for review in data_list]
data_list = [re.sub(r'READ MORE', '', review) for review in data_list]

# Print the first element of the preprocessed data_list
print(data_list[0])

"""# 2. Run sentiment analysis predictions by using Pipeline"""

from transformers import pipeline

# Using pipeline class to make predictions from models available in the Hub in an easy way

sentiment_pipeline = pipeline("sentiment-analysis")
sample_data = ["I love & you", "I hate you"]
sentiment_pipeline(sample_data)

sentiments = sentiment_pipeline(data_list)
print (sentiments[0:5])
sentiment_labels = []
for sentiment_label in sentiments:
  sentiment_labels.append(sentiment_label['label'])

# prompt: count the total POSITIVE and NEGATIVE values in sentiment_labels list. After that display some sample items corresponding to negative values from the original data_list

# Count the total positive and negative values in sentiment_labels list
positive_count = sentiment_labels.count('POSITIVE')
negative_count = sentiment_labels.count('NEGATIVE')

# Display the count of positive and negative values
print(f"Total positive reviews: {positive_count}")
print(f"Total negative reviews: {negative_count}")

# Display some sample items corresponding to negative values from the original data_list
count_samples = 0
for i, sentiment in enumerate(sentiment_labels):
  if sentiment == 'NEGATIVE':
    count_samples += 1
    print(f"Review: {data_list[i]}")
    if count_samples == 25:
      break

